import React, { Component } from "react";

export class Post extends Component {
  state = {
    post: {},
  };
  componentDidMount() {
    fetch("https://jsonplaceholder.typicode.com/posts")
      .then((response) => {
        return response.json();
      })
      .then((result) => {
        this.setState({ post: result });
      });
  }
  render() {
    return <div></div>;
  }
}

export default Post;
